            "\"L\'étoile Suhail est l\'une des étoiles qui intéresse le plus les gens depuis l\'Antiquité dans la péninsule arabique, car son aube à l\'horizon sud indique le début du compte à rebours de l\'été dans la région, et cette étoile est observée avec le à l\'œil nu du sud de la péninsule arabique jusqu\'à son milieu le 24 août. coïncidant avec l\'émergence de l\'étoile Suhail est l\'angle de recul des rayons du soleil, et le jour commence à raccourcir progressivement et à se refroidir de manière significative à la fin de la nuit. Le soleil tend vers le sud après avoir été vertical au début de la été, donc les Arabes attendaient avec impatience la montée de cette étoile. Elle est agréable la nuit avec la température restant dans la journée, puis (Al Jabha) et elle s\'étend sur 13 jours, et c\'est la première étoile de l\'automne saison et la nuit y devient froide et le temps s\'améliore pendant la journée, puis (Al Zubrah) et cela dure 13 jours et dans lequel il fait plus froid la nuit, puis (Al Saraffa), qui est la dernière des étoiles Suhail , et il s\'étend sur une période de 13 jours, et s\'appelait ainsi pour le départ de la chaleur lorsqu\'elle se lève. L\'étoile de Suhail est à 313 années-lumière du globe, et c\'est l\'étoile la plus brillante du groupe d\'étoiles (Carina) à la base sud, et la deuxième étoile la plus brillante la nuit après Sirius. L\'étoile de Suhail n\'a aucun effet sur conditions météorologiques, ni de près ni de loin, comme les autres étoiles, mais cette étoile n\'est qu\'un signe, et son apparition coïncide avec le début du changement de saison et la transition vers l\'équinoxe d\'automne."),
